```
// Define canvas and context
const canvas = document.querySelector("canvas");
const context = canvas.getContext("2d");

// Define numer of rows in triangle
const numRows = 4;

// Define triangle values for first row
let rows = [[1]];

// Loop through rows and add each row to rows array
for (let i = 1; i < numRows + 1; i++) {
    rows.push([]);
}

// Fill in rows starting from top row and working down
for (let i = numRows; i >= 0; i--) {
    for (let j = 0; j <= i; j++) {
        rows[i][j] = rows[i - 1][j] + rows[i - 1][j + 1];
    }
}

// Define colors for each value in triangle
const colors = ["#53ADE8", "#F6D05A", "#F89028", "#F91820"];

// Loop through rows and draw each row
for (let i = numRows; i >= 0; i--) {
    for (let j = 0; j <= i; j++) {
        context.fillStyle = colors[j];
        context.fillRect(j * 30 + 10, i * 30 + 10, 20, 20);
    }
}

// Draw border
context.strokeStyle = "black";
context.strokeRect(0, 0, canvas.width, canvas.height);
```
