```

This program works by iterating over the numbers from 1 to 100. For each number, it checks if it is a multiple of 3, 5, or both. If it is a multiple of both 3 and 5, it prints "FizzBuzz". If it is a multiple of 3, it prints "Fizz" and if it is a multiple of 5, it prints "Buzz". Otherwise, it prints the number as is.

